import React from "react";
import Card from "./card";

const Cardlist = ({services}) => {
    return(
        <div>
            <Card id={services[0].id} username={services[0].username} />
            <Card id={services[1].id} username={services[1].username} />
            <Card id={services[2].id} username={services[1].username} />
        </div>
    );
}

export default cardlist;
